import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    loginScreen: {
        width: '85%',
        height: '90%',
        marginTop: 35,
        marginLeft: 'auto',
        marginRight: 'auto',
        display: 'flex',
        flex: 1,
      },
      loginContainer: {
        width: '100%',
        display: 'flex',
        flex: 1,
        height: '100%',
        marginLeft: 'auto',
        marginRight: 'auto',
      },
      textinput:{
        height: 40,
        borderWidth: 2,
        borderRadius: 5,
        borderColor: '#172C5D',
        padding: 10,
        marginBottom: 30,
      },
      text:{
        fontSize: 15,
        marginBottom: 3,
      }
});

export default styles;
